import React from 'react';
import { render } from 'react-dom';
import  Pet from './pet';



class App extends React.Component {

    render() {
        return (
            <div>
                <h1>Adopt me!</h1>
                <Pet name="luna" animal="dog" breed="havanese" />
                <Pet name="jack" animal="bird" breed="parrot" />
                <Pet name="david" animal="cat" breed="mixed" />
            </div>
        )

